  return (
    <div>
        <h1 align='center'>My task list</h1>
      <FORM></FORM>


      <BrowserRouter>
        <Route path='/' ></Route>

      </BrowserRouter>

      <DISPLAY></DISPLAY>
      <COMPLETED></COMPLETED>
    </div>
  );
}

export default App;
